Hidden from the screaming chainsaws of government-sanctioned old-growth loggers, during the worst heat wave on record in Canada, I spoke to one of the original forest protectors. Please support @endangeredecosystemsalliance  in their tireless drive to change policy in BC Canada. Thank you Ken Wu for this incredible journey into the last of the untouched ancient forests of BC. Help us by speaking out. The massacre of these trees, and the irreplaceable ecosystems that they support, must be halted immediately.
