A new mini-documentary by the Endangered Ecosystems Alliance that undertakes an expansive overview of the core issues surrounding BC's War in the Woods over the last stands of endangered old-growth forests on the coast. Edited by Darryl Augustine. This is the first video in the "Amazing Ecosystems of Canada" mini-documentary series that we are producing in the lead-up to the UN Biodiversity Conference in October of 2021, where a new global protected areas target and policies will be negotiated. Please watch and share, and help us finish producing the rest of the series by donating at the link in our profile!
